import { Routes } from '@angular/router';

import { ErrorComponent } from './error.component';
import { Connect403Component } from './ic-403.component';
import { Connect404Component } from './ic-404.component';
import { Connect500Component } from './ic-500.component';
import { Connect502Component } from './ic-502.component';
import { Connect503Component } from './ic-503.component';
import { Connect504Component } from './ic-504.component';

export const errorRoute: Routes = [
  {
    path: 'error',
    component: ErrorComponent,
    data: {
      authorities: [],
      pageTitle: 'error.title',
    },
  },
  {
    path: 'accessdenied',
    component: ErrorComponent,
    data: {
      authorities: [],
      pageTitle: 'error.title',
      errorMessage: 'error.http.403',
    },
  },
  {
    path: 'error/404',
    component: Connect404Component,
    data: {
      pageTitle: 'global.title',
    },
  },
  {
    path: 'error/403',
    component: Connect403Component,
    data: {
      pageTitle: 'global.title',
    },
  },
  {
    path: 'error/500',
    component: Connect500Component,
    data: {
      pageTitle: 'global.title',
    },
  },
  {
    path: 'error/502',
    component: Connect502Component,
    data: {
      pageTitle: 'global.title',
    },
  },
  {
    path: 'error/503',
    component: Connect503Component,
    data: {
      pageTitle: 'global.title',
    },
  },
  {
    path: 'error/504',
    component: Connect504Component,
    data: {
      pageTitle: 'global.title',
    },
  },
];
